create table doctors
(
    doctor_id      int auto_increment
        primary key,
    name           varchar(50)  not null,
    gender         varchar(1)   null,
    age            int          not null,
    positions_id   int          null,
    department_id  int          null,
    avatar_url     varchar(255) null,
    average_rating float        null,
    rating_count   int          null,
    work_years     int          null comment '工作年龄/工作时长(年)',
    constraint doctors_ibfk_1
        foreign key (department_id) references departments (department_id)
            on update cascade on delete cascade,
    constraint fk_positions_id
        foreign key (positions_id) references positions (positions_id)
            on delete set null
);

create index fk_doctor_position
    on doctors (positions_id);

create index idx_doctors_department_id
    on doctors (department_id);

